contracts/voting.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingContract{

     address electionCommission;
    //custom data structure
    struct candidate{
        string name;
        string symbol;
        uint voteCount;
    }

    candidate[] Candidates; //list of candidate

    //setting authority
    constructor(){
        electionCommission = msg.sender;
    }
     function registrationForCandidate  (string memory name, string memory symbol)public
     {
         require(msg.sender!=electionCommission,"Unauthorized Acess");
         

     }



}

